import java.io.BufferedOutputStream;
import java.io.File;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import java.util.Iterator;
import java.util.LinkedHashMap;
import java.util.Set;

import javax.xml.bind.DatatypeConverter;

public class Base64ImageConvertor {

	public static void main(String[] args)
	{
		LinkedHashMap imageHash=new LinkedHashMap();
		String image1="\r\n" + 
				"\r\n" + 
				"\"\"";
	
		String image1_name="image1.png";
		String image2="\r\n" + 
				"\r\n" + 
				"\"\"";
	
		String image2_name="image2.png";
		String image3="\r\n" + 
				"\r\n" + 
				"\"\"";
	
		String image3_name="image3.png";
		
		imageHash.put(image1_name, image1);
		imageHash.put(image2_name, image2);
		imageHash.put(image3_name, image3);
		convertImage(imageHash);
		
	}
	
	public static void convertImage(LinkedHashMap image_list)
	{
		StringBuffer response=new StringBuffer();
		Set<String> keys = image_list.keySet();
        for(String k:keys)
        {        
	         byte[] data = DatatypeConverter.parseBase64Binary((String) image_list.get(k));
		        String path = "C:\\Mahendra Work Details\\upload\\"+k;
		        response.append(path);
		        File file = new File(path);
		        try (OutputStream outputStream = new BufferedOutputStream(new FileOutputStream(file))) 
		        {
		          outputStream.write(data);
		          response.append(" successfully written \n");
		        } 
		        catch (IOException e) 
		        {
		            e.printStackTrace();
		        }
  
	      }
        System.out.println(response);
		}
}
